import './App.css';
import React, { useState, useEffect } from "react"; 
import { Input } from 'antd';
const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
      <Input size="large" placeholder="large size" />
      </header>
    </div>
  );
}

export default App;
